import React from 'react';
import './styles.css';
import logo from './logo.svg'
import 'materialize-css';
import { Navbar, NavItem, Icon } from 'react-materialize' 

function App() {
  return (
    <div className="App">
      <Navbar
        alignLinks="left"
        brand={<a className="brand-logo" href="#">Logo</a>}
        centerLogo
        menuIcon={<Icon>menu</Icon>}
        options={{
          draggable: true,
          edge: 'left',
          inDuration: 250,
          onCloseEnd: null,
          onCloseStart: null,
          onOpenEnd: null,
          onOpenStart: null,
          outDuration: 200,
          preventScrolling: true
        }}
      >
        <NavItem onClick={function noRefCheck(){}}>
          Getting started
        </NavItem>
        <NavItem href="components.html">
          Components
        </NavItem>
      </Navbar>
    </div>
  );
}

export default App;
